import React from 'react'
import { Card,CardHeader, CardContent, IconButton, Typography, makeStyles } from '@material-ui/core'
import {DeleteOutlined} from '@material-ui/icons'

const useStyles = makeStyless({
    test: {
      border: (note) =>{
        if(note.category == 'work'){
          return '1px solid red'
        }
      }
    }
  })

function NoteCard(props) {
    const {note, handleDelete} = props
    const classes = useStyles()
    const Delete = (id) => {
        console.log(id)
        handleDelete(id)
    }
    return (
        <div>
            <Card key={note.id} elevation={1} className={classes.test}>
                <CardHeader
                action={
                    <IconButton onClick={()=> Delete(note.id)}>
                        <DeleteOutlined/>
                    </IconButton>
                }
                title={note.title}
                subheader = {note.category}
                />
                <CardContent>
                    <Typography variant="body2">{note.details}</Typography>
                </CardContent>
            </Card>
        </div>
    )
}

export default NoteCard
